#bootstrap fix for form element in xs

input[type="file"] {
  width: 100%;
}

#CSS avoid parents

&lt;!-- Not so great --&gt;
&lt;span class="avatar"&gt;
  &lt;img src="..."&gt;
&lt;/span&gt;

&lt;!-- Better --&gt;
&lt;img class="avatar" src="..."&gt;

#html right semantic

&lt;!-- bad --&gt;
&lt;i class="fa fa-home"&gt;&lt;/i&gt;

&lt;!-- good --&gt;
&lt;span class="fa fa-home"&gt;&lt;/span&gt;

#CSS // remove outline in FF
select:-moz-focusring {
color: transparent;
text-shadow: 0 0 0 #000;
}

#CSS Media Queries
@media (min-width: 768px) {}
@media (min-width: 992px) {}
@media (min-width: 1170px) {}

